css:
@-moz-document domain("youtube.com")
{
  .html5-play-progress, .ytp-play-progress
  {
    background: url(https://www.transparenttextures.com/patterns/asfalt-light.png) repeat-x !important;
    background: url(https://www.transparenttextures.com/patterns/asfalt-light.png) !important;
  }

  .html5-load-progress, .ytp-load-progress
  {
    background: url(data:image/png;base64,) !important;
  }

  .html5-scrubber-button, .ytp-scrubber-button
  {
   backround:url(data:image/png;base64,) !important;
    width: 34px !important;
    height: 21px !important;
    border: none !important;
    margin-left: -18px !important;
    margin-top: 0px !important;
   /*[[show_nyan]]*/;
  }

  .ytp-progress-bar-container:hover .ytp-scrubber-button,
.ytp-progress-bar-container:hover .ytp-load-progress
  {
    image-rendering: pixelated;
  }

  .html5-progress-bar-container, .ytp-progress-bar-container
  {
    height: 12px !important;
  }

  .html5-progress-bar, .ytp-progress-bar
  {
    margin-top: 12px !important;
  }

  .html5-progress-list, .ytp-progress-list, .video-ads .html5-progress-list.html5-ad-progress-list, .video-ads .ytp-progress-list.ytp-ad-progress-list
  {
    height: 12px !important;
  }

  .ytp-volume-slider-track
  {
    background:url(https://i.guim.co.uk/img/media/d0105731685e5b2b3daecf2fa00c9affaba832f1/0_0_2560_1536/master/2560.jpg?width=1200&height=900&quality=85&auto=format&fit=crop&s=813bbc6e03dae66c2d041b98615ea63c) !important;
  }
}
